The dataset cannot be made publicly available, but the raw data files can be downloaded from the [World Values Survey](https://www.worldvaluessurvey.org/WVSDocumentationWV7.jsp) website free of charge upon registration. The dataset can be reproduced from the raw data file with the `R` code shown below.


::: {.cell}

```{.r .cell-code  code-fold="true" code-summary="Show the code for importing and selecting the data"}
## Packages (install first if needed) ----------------------------------------------------------------------------------------

library(here)                     # Directory/folder management
library(fs)                       # Directory/folder management
library(datawizard)               # Data manipulation

## Path to file --------------------------------------------------------------------------------------------------------------

dir <- here("Data", "wvs7")
file <- "F00010733-WVS_Cross-National_Wave_7_spss_v5_0.zip"
filepath <- path(dir, file)

## Read in the data file -----------------------------------------------------------------------------------------------------

wvs7 <- data_read(filepath) |> 
  data_select(select = c(B_COUNTRY, G_TOWNSIZE, H_SETTLEMENT,
                         H_URBRURAL,                                # Technical variables
                         Q1:Q259,                                   # Core variables
                         Q260:Q290),                                # Demographic and socio-economic variables
              exclude = c(Q82_AFRICANUNION:Q82_UNDP,                # Exclude: region specific,
                          Q91:Q93,                                  # knowledge test,
                          Q223, Q266:Q268, Q290)                    # too detailed
              ) |> 
  data_select(exclude = c(ends_with("R", "A", "CS9"),               # recoded, country-specific
                          contains("_", "X00", "V00"))
              )
```
:::



